latest_odometer_df = pd.read_sql_query(latest_odometer_query, engine)

import pandas as pd
from datetime import datetime, timedelta

# Assuming you already have:
# data = pd.read_sql_query(sql_query, engine)
data = pd.read_sql_query(sql_query, engine)
# Step 1: Create list of past 12 months in 'Apr_24', 'May_24', ... format
end_date = datetime.today()
start_date = end_date - timedelta(days=365)
months_order = pd.date_range(start=start_date, end=end_date, freq='MS').strftime('%b_%y').tolist()

# Step 2: Pivot each metric
pivot_fc = data.pivot(index='Chassis_no', columns='Month_Y', values='totalFCSum').add_prefix('totalFC_')
pivot_distance = data.pivot(index='Chassis_no', columns='Month_Y', values='totalDistanceSum').add_prefix('totalDistance_')
pivot_def = data.pivot(index='Chassis_no', columns='Month_Y', values='DEF').add_prefix('DEF_')
pivot_fe = data.pivot(index='Chassis_no', columns='Month_Y', values='FE').add_prefix('FE_')
pivot_adblue = data.pivot(index='Chassis_no', columns='Month_Y', values='AdBlue_Efficiency').add_prefix('AdBlueEff_')

# Step 3: Reorder columns in chronological order
def reorder_columns(df, prefix):
    ordered_cols = [f"{prefix}{month}" for month in months_order if f"{prefix}{month}" in df.columns]
    return df.reindex(columns=ordered_cols)

pivot_fc = reorder_columns(pivot_fc, 'totalFC_')
pivot_distance = reorder_columns(pivot_distance, 'totalDistance_')
pivot_def = reorder_columns(pivot_def, 'DEF_')
pivot_fe = reorder_columns(pivot_fe, 'FE_')
pivot_adblue = reorder_columns(pivot_adblue, 'AdBlueEff_')

# Step 4: Combine all pivoted data
final_df = pivot_fc.join([
    pivot_distance, pivot_def, pivot_fe, pivot_adblue
], how='outer').fillna(0)

# Step 5: Add total and efficiency summary columns
final_df['totalFC_Sum'] = final_df.filter(like='totalFC_').sum(axis=1)
final_df['totalDistance_Sum'] = final_df.filter(like='totalDistance_').sum(axis=1)
final_df['DEF_Sum'] = final_df.filter(like='DEF_').sum(axis=1)

# Avoid division by zero
final_df['FE_Overall'] = final_df['totalDistance_Sum'] / final_df['totalFC_Sum']
final_df['AdBlueEff_Overall'] = (final_df['DEF_Sum'] / final_df['totalFC_Sum']) * 100

# Step 6: Reset index and export to Excel
final_df.reset_index(inplace=True)
# Merge with final_df using Chassis_no as key
final_df = final_df.merge(latest_odometer_df, how='left', on='Chassis_no')

output_file = r'/data/vecv/scripts/retail/fuel_efficiency_full_summary1.xlsx'
final_df.to_excel(output_file, index=False)
